INSERT INTO step(recipe_id, step_order, details) VALUES (1, 1, 'In a large bowl, toss the potato wedges with olive oil, salt, pepper, and any desired seasonings.');
INSERT INTO step(recipe_id, step_order, details) VALUES (1, 2, 'In a large bowl, mix together the flour, sugar, baking powder, and salt.');
INSERT INTO step(recipe_id, step_order, details) VALUES (1, 3, 'Season with salt and pepper to taste.');
INSERT INTO step(recipe_id, step_order, details) VALUES (1, 4, 'Spread the potato wedges in a single layer on a baking sheet.');
INSERT INTO step(recipe_id, step_order, details) VALUES (1, 5, 'Grill the skewers for 10-15 minutes, turning occasionally, until the meat is cooked through and the vegetables are tender.');
INSERT INTO step(recipe_id, step_order, details) VALUES (1, 6, 'Bring the mixture to a boil, then reduce the heat and let it simmer for 25-30 minutes, or until the lentils are tender.');
INSERT INTO step(recipe_id, step_order, details) VALUES (1, 7, 'Preheat the oven to 375°F (190°C).');
INSERT INTO step(recipe_id, step_order, details) VALUES (1, 8, 'Add the chopped vegetables to the skillet and cook for an additional 5-7 minutes.');
INSERT INTO step(recipe_id, step_order, details) VALUES (1, 9, 'Serve hot, garnished with fresh herbs or a dollop of yogurt if desired."');
INSERT INTO step(recipe_id, step_order, details) VALUES (1, 10, 'Serve the skewers with a side of rice or salad.');
INSERT INTO step(recipe_id, step_order, details) VALUES (1, 11, 'Spread the potato wedges in a single layer on a baking sheet.');
INSERT INTO step(recipe_id, step_order, details) VALUES (1, 12, 'Season with salt and pepper to taste.');
